class ListcommandemagComponent {
    constructor(service, router, toastr, fb, datePipe) {
        this.service = service;
        this.router = router;
        this.toastr = toastr;
        this.fb = fb;
        this.datePipe = datePipe;
        this.p = 1;
    }
    ngOnInit() {
        this.refreshListe();
        //this.getData();
    }
    refreshListe() {
        this.service.getAll1().subscribe(response => { this.commandeListe = response; });
    }
    onDelete(id) {
        if (window.confirm('Are sure you want to delete this Article ?')) {
            this.service.deleteAll(id)
                .subscribe(data => {
                console.log(data);
                this.toastr.warning(' data successfully deleted!');
                this.refreshListe();
            }, error => console.log(error));
        }
    }
    newComm() {
        this.service.choixmenu = "A";
        this.router.navigate(['/commandemag']);
    }
    onDetail(comm) {
        let navigationExtras = {
            queryParams: {
                special: btoa(JSON.stringify(comm))
            }
        };
        this.router.navigate(['updatecommandemag'], navigationExtras);
    }
    onSelect(item) {
        this.service.formData = this.fb.group(Object.assign({}, item));
        this.service.choixmenu = "M";
        this.router.navigate(['/commandemag']);
    }
    transformDate(date) {
        return this.datePipe.transform(date, 'yyyy-MM-dd');
    }
}
