            this.f['pu'].setValue(this.articleList[ctrl.selectedIndex - 1].pv);
            this.f['tva'].setValue(this.articleList[ctrl.selectedIndex - 1].tva);
            this.f['libart'].setValue(this.articleList[ctrl.selectedIndex - 1].libelle);
